    <style>

/* ========================= */
/* ======== general ======== */
/* ========================= */

body {
  font-family: 'Helvetica';
  font-weight: normal;
  text-align: justify;
  background-color: #B0B0B0;
  display: flex;
  flex-direction: column;
}

h1, h2, h3, h4, h5, h6 {
  font-weight: bold;
  line-height: 1.0;
  margin: 0 0 5px 0;
}

h1 {
  font-size: 200%;
  display: block;
  background-color: #A0A0F0;
  padding: 5px;
  margin-bottom: 15px; 
  color: #202020;
} 

h2 { font-size: 160% }
h3 { font-size: 140% }
h4 { font-size: 130% }
h5 { font-size: 120% }
h6 { font-size: 110% }

div.block {
  border: solid gray 1px;
  margin: 10px 0px 10px 0px;
  padding: 10px 10px 10px 10px;
  background-color: #F0F0FF;
  position: relative;
  color: #202020;
  display: flex;
  flex-direction: column;
  justify-content: center;
}

div.block img, table, pre, .graph {
  margin-left: auto;
  margin-right: auto;
}

p {
}

pre, .graph {
  font-size: 120%;
  display: block;
  background-color: #FFFFFF;
  padding: 5px;
}

pre, .graph, div.block, h1, table {
  border: 1px solid gray;
  border-radius: 5px;
  box-shadow: 1px 1px 3px rgba(0, 0, 0, 0.3);
}

table
{
  border-collapse: collapse;
  font-size: 1.0em;
  background-color: #FFFFFF;
  border: none;
  margin-top: 1em;
  margin-bottom: 1em;
}


.ok {
  background-color: #40FF40;
}

.error {
  background-color: #FF4040;
}

.warning {
  background-color: #FFFF40;
}

th
{
  font-weight: bold;
  background-color: #A0A0F0;
  padding: 0.2em;
  border: 1px solid gray;
  text-align: center;
}

td
{
  padding: 0.2em;
  border: 1px solid gray;
  border-top: none;
}

tr.bold {
  font-weight: bold;
}

/* ===== timeline ===== */

.chart {
	shape-rendering: crispEdges;
}

.mini text {
	font: 9px sans-serif;	
}

.main text {
	font: 12px sans-serif;	
}

.miniItem0 {
	fill: darksalmon;
	stroke-width: 6;	
}

.miniItem1 {
	fill: darkolivegreen;
	fill-opacity: .7;
	stroke-width: 6;	
}

.miniItem2 {
	fill: slategray;
	fill-opacity: .7;
	stroke-width: 6;	
}

.brush .extent {
	stroke: gray;
	fill: dodgerblue;
	fill-opacity: .365;
}

    </style>
